import React from "react";
import './interes.css';

function Interes() {
    return (
        <div className="interes">
            <h3>Te puede interesar</h3>
            <ul>
                <li>Beneficios: Disfruta de promociones, descuentos y más en UTP</li>
                <li>Ingresa a biblioteca: Encuentra recursos, libros y más</li>
                <li>Bolsa de trabajo: Encuentra ofertas laborales exclusivas para ti</li>
                <li>Empleabilidad: Conoce más sobre tu ruta laboral con UTP</li>
            </ul>
        </div>
    );
}

export default Interes;
